import React from 'react';
import { Card, Badge } from 'react-bootstrap';
import "../classwork/classwork.css";

function isCompleted(class_status){
    if (class_status == "true"){
        return <Badge variant="success">Completed</Badge>;
    } else {
        return <Badge variant="warning">In Progress</Badge>;
    }
}

export const School_Card = props => (
    <Card className='carditem'>
        <Card.Header>{props.school.school} {isCompleted(props.school.status)} </Card.Header>
            <Card.Body>
                <Card.Text>
                    {props.school.certificate} 
                </Card.Text>  
            </Card.Body>
    </Card>
);
